import React from "react";
import Frame36255 from "../Frame36255";
import Frame36264 from "../Frame36264";
import Frame36194 from "../Frame36194";
import EditPlus from "../EditPlus";
import "./Frame35393.css";

function Frame35393(props) {
  const { frame36255Props, frame362552Props, frame36264Props, frame36194Props, editPlusProps, className } = props;

  return (
    <div className={`frame-35395 border-0-5px-abbey ${className || ""}`}>
      <Frame36255 name={frame36255Props.name} />
      <Frame36255 name={frame362552Props.name} className="frame-3626-14" />
      <Frame36264 fruits={frame36264Props.fruits} className="frame-3627-13" />
      <div className="frame-3660">
        <div className="group-19432">
          <Frame36194 userUserProps={frame36194Props.userUserProps} className="frame-36203" />
        </div>
        <div className="frame-36197 border-0-5px-rusty-red">
          <EditPlus editPlus={editPlusProps.editPlus} className="menu-closebig-1" />
        </div>
      </div>
    </div>
  );
}

export default Frame35393;
